import{_ as e,c as a,o as t,V as o}from"./chunks/framework.DA-dnmTz.js";const p=JSON.parse('{"title":"Kontakty","description":"","frontmatter":{"title":"Kontakty","sidebar":false},"headers":[],"relativePath":"about.md","filePath":"about.md"}'),i={name:"about.md"},n=o('<h1 id="o-nas" tabindex="-1">O nás <a class="header-anchor" href="#o-nas" aria-label="Permalink to &quot;O nás&quot;">​</a></h1><p>Jsme Ultimate Frisbee tým z Českých Budějovic. Hrajeme už přes 30 let, a během poslední dekády jsme se vypracovali na jeden z nejúspěšnějších týmů v ČR i Evropě! Každoročně sbíráme medailová umístění z národních soutěží a také se skvěle umisťujeme na finálovém turnaji evropské ligy.</p><h2 id="ale-co-je-hlavni" tabindex="-1">Ale co je hlavní? <a class="header-anchor" href="#ale-co-je-hlavni" aria-label="Permalink to &quot;Ale co je hlavní?&quot;">​</a></h2><p>Jsme parta kamarádů, kteří spolu rádi tráví čas i mimo frisbee. Od nejrůznějších teambuildingů, přes soustředění, oslavy, nebo prostě jen večerní grilování. Jakmile se k nám připojíš, jsi jedním z nás a už budeš napořád.</p><h2 id="historie" tabindex="-1">Historie <a class="header-anchor" href="#historie" aria-label="Permalink to &quot;Historie&quot;">​</a></h2><p>Do Českých Budějovic Ultimate Frisbee přinesl náš „zakladatel“, David Novák, řečený „Davídek“. Svou kariéru odstartoval v Praze při studiích na vysoké škole. Hrál v té době za Prague Devils, kteří tehdy byli jedním z mála kvalitních klubů v ČR. Po studiích a návratu do Českých Budějovic v roce 1993 však Davídek nechtěl dát ultimate sbohem a rozhodl se, že založí vlastní tým. Hlavním zdrojem hráčů se v té době stali studenti, které Davídek oslovil přes svého bratra, a pod tehdejším názvem Hurricanes absolvovali své první tréninky a turnaje, ač neměli žádné zázemí. Brzy se však tým rozšířil, a po třech letech, v roce 1996, tým získal titul mistra ČR.</p><h2 id="oceneni" tabindex="-1">Ocenění <a class="header-anchor" href="#oceneni" aria-label="Permalink to &quot;Ocenění&quot;">​</a></h2><p>Během naší existence jsme dosáhli mnoha úspěchů a stále sbíráme další!</p><ul><li>8 titulů MČR v Mixed kategorii</li><li>8 titulů MČR v Women kategorii</li><li>7 titulů MČR v Open kategorii</li></ul>',9),s=[n];function l(r,d,c,h,m,v){return t(),a("div",null,s)}const k=e(i,[["render",l]]);export{p as __pageData,k as default};
